import React from 'react'
import ReactDom from 'react-dom'

// stateless functional component
// always return JSX

// const Greeting = () => {
//   return React.createElement('h1',{},'hello world')
// }

function Greeting() {
  return (
    <div>
      <h3>hello world</h3>
      <ul>
        <li>
          <a href='#'>hello world</a>
        </li>
      </ul>
    </div>
  )
}

ReactDom.render(<Greeting />, document.getElementById('root'))
